import React from 'react';
import TableList from './TableList';
import OrderForm from './OrderForm';

const FrontPage = () => {
    return (
        <div>
            <h1>Restaurant Management System</h1>
            <TableList />
            <OrderForm />
        </div>
    );
};

export default FrontPage;
